import axios from "axios";

export const getButtons = congress => {
  return axios
    .get("http://127.0.0.1:5000/api/" + congress.toString())
    .then(response => {
      var retData = [];
      Object.keys(response.data.reps).forEach(rep => {
        retData.push(rep.id.bioguide);
      });
      return retData;
    });
};
